import React from 'react';
import Tilty from 'react-tilty';

const Logo = () => {
	return(
			<div className="ma4 mt0">
				<Tilty className='br3 shadow-2' reverse axis="x" scale={1.2} perspective={900} reset={false}>
				  <div>This is my content</div>
				</Tilty>
			</div>
		);
}

export default Logo;
